 0%,#aaca94 44%,#5bba56 100%); /* Chrome10+,Safari5.1+ */\r\n       background: -o-linear-gradient(top, #d7e7b3 0%,#aaca94 44%,#5bba56 100%); /* Opera11.10+ */\r\n     background: -ms-linear-gradient(top, #d7e7b3 0%,#aaca94 44%,#5bba56 100%); /* IE10+ */\r\n      filter: progid:DXImageTransform.Microsoft.gradient( startColorstr=''#d7e7b3'', endColorstr=''#5bba56'',GradientType=0 ); /* IE6-9 */\r\n        background: linear-gradient(top, #d7e7b3 0%,#aaca94 44%,#5bba56 100%); /* W3C */}\r\n       \r\n    .vbl-more-info-button {\r\n     display: inline-block;\r\n\r\n      margin: 0px 5px 0px 0px !important;\r\n     float: right;\r\n\r\n       padding: 10px !important;\r\n\r\n       background: #e6e6e6; /* Old browsers */\r\n     background: -moz-linear-gradient(top, #e6e6e6 0%, #cccccc 40%, #a7a7a7 100%); /* FF3.6+ */\r\n      background: -webkit-gradient(linear, left top, left bottom, color-stop(0%,#e6e6e6), color-stop(40%,#cccccc), color-stop(100%,#a7a7a7)); /* Chrome,Safari4+ */\r\n       background: -webkit-linear-gradient(top, #e6e6e6 0%,#cccccc 40%,#a7a7a7 100%); /* Chrome10+,Safari5.1+ */\r\n       background: -o-linear-gradient(top, #e6e6e6 0%,#cccccc 40%,#a7a7a7 100%); /* Opera11.10+ */\r\n     background: -ms-linear-gradient(top, #e6e6e6 0%,#cccccc 40%,#a7a7a7 100%); /* IE10+ */\r\n      filter: progid:DXImageTransform.Microsoft.gradient( startColorstr=''#e6e6e6'', endColorstr=''#a7a7a7'',GradientType=0 ); /* IE6-9 */\r\n        background: linear-gradient(top, #e6e6e6 0%,#cccccc 40%,#a7a7a7 100%); /* W3C */\r\n\r\n        border: 1px solid #c1c4be;\r\n\r\n      -webkit-border-radius: 3px;\r\n     -moz-border-radius: 3px;\r\n        border-radius: 3px;\r\n }\r\n\r\n   .vbl-more-info-button:link, .vbl-more-info-button:visited, .vbl-more-info-button:hover, .vbl-more-info-button:active {text-decoration: none; font-weight: bold; color: #ffffff !important;}\r\n .vbl-more-info-button:hover, .vbl-more-info-button:active {\r\n background: #f8f8f8; /* Old browsers */\r\n background: -moz-linear-gradient(top, #f8f8f8 0%, #dcdcdc 40%, #b4b4b4 100%); /* FF3.6+ */\r\n  background: -webkit-gradient(linear, left top, left bottom, color-stop(0%,#f8f8f8), color-stop(40%,#dcdcdc), color-stop(100%,#b4b4b4)); /* Chrome,Safari4+ */\r\n   background: -webkit-linear-gradient(top, #f8f8f8 0%,#dcdcdc 40%,#b4b4b4 100%); /* Chrome10+,Safari5.1+ */\r\n   background: -o-linear-gradient(top, #f8f8f8 0%,#dcdcdc 40%,#b4b4b4 100%); /* Opera11.10+ */\r\n background: -ms-linear-gradient(top, #f8f8f8 0%,#dcdcdc 40%,#b4b4b4 100%); /* IE10+ */\r\n  filter: progid:DXImageTransform.Microsoft.gradient( startColorstr=''#f8f8f8'', endColorstr=''#b4b4b4'',GradientType=0 ); /* IE6-9 */\r\n    background: linear-gradient(top, #f8f8f8 0%,#dcdcdc 40%,#b4b4b4 100%); /* W3C */}\r\n</style>\r\n\r\n<div id="vbl-search-results-header">\r\n   [@besked]\r\n</div>\r\n\r\n<ul id="vbl-product-list">\r\n[@nøgleord_start]\r\n<li>\r\n  <p class="vbl-product-description">\r\n     [@nøgleord_text]\r\n    </p>\r\n</li>\r\n[@nøgleord_slut]\r\n[@produktliste_start]\r\n  <li>\r\n\r\n        <a class="vbl-buy-now-button" href="[@køb_nu_link]">Læg i kurv</a>\r\n      <a class="vbl-more-info-button" href="[@produkt_link]">Mere info</a>\r\n        <img src="[@billede_sti]" alt="[@produkt_navn]" />\r\n      <a class="vbl-product-name" href="[@produkt_link]">[@produkt_navn]</a><br />\r\n        [@pris_discount]\r\n        <p class="vbl-product-description">\r\n         [@beskrivelse] ...\r\n      </p>\r\n\r\n    </li>\r\n[@produktliste_slut]\r\n</ul>', 0),
