(28, 'Dramatically Different High Performance GraphicsIntroducing the Millennium G400 Series - a dramatically different, high performance graphics experience. Armed with the industry''s fastest graphics chip, the Millennium G400 Series takes explosive acceleration two steps further by adding unprecedented image quality, along with the most versatile display options for all your 3D, 2D and DVD applications. As the most powerful and innovative tools in your PC''s arsenal, the Millennium G400 Series will not only change the way you see graphics, but will revolutionize the way you use your computer.Key features:New Matrox G400 256-bit DualBus graphics chipExplosive 3D, 2D and DVD performanceDualHead DisplaySuperior DVD and TV output3D Environment-Mapped Bump MappingVibrant Color Quality rendering UltraSharp DAC of up to 360 MHz3D Rendering Array ProcessorSupport for 16 or 32 MB of memory', 2, 8, '', ''),
