

CREATE TABLE IF NOT EXISTS `categories` (
  `cid` int(11) NOT NULL COMMENT 'Not Auto increment ',
  `name` varchar(30) COLLATE utf8_unicode_ci NOT NULL,
  `parent_id` int(11) NOT NULL,
  `description` text COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`cid`),
  KEY `parent_id` (`parent_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE IF NOT EXISTS `layouts` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `html` text COLLATE utf8_unicode_ci NOT NULL,
  `type` int(2) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=81 ;


CREATE TABLE IF NOT EXISTS `options` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=18 ;


CREATE TABLE IF NOT EXISTS `options_settings` (
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `importancy` enum('0','1','2','3') COLLATE utf8_unicode_ci NOT NULL COMMENT '0 = dont care, 1 = less import, 2 = medium , 3= super very important',
  `sortable` set('not','string','number') COLLATE utf8_unicode_ci NOT NULL,
  `r_display_identifier` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `facet_type` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'In text',
  PRIMARY KEY (`name`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE IF NOT EXISTS `options_values` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` text COLLATE utf8_unicode_ci NOT NULL,
  `product_id` int(11) NOT NULL,
  `option_id` int(11) NOT NULL,
  `price_prefix` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `price` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=436 ;


CREATE TABLE IF NOT EXISTS `products` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Produkt id',
  `updated` varchar(10) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Sidst opdateret',
  `pid` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `boosted` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=29 ;


CREATE TABLE IF NOT EXISTS `products_boost` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_id` int(11) NOT NULL,
  `date_start` int(11) NOT NULL,
  `date_end` int(11) NOT NULL,
  `action` varchar(100) CHARACTER SET utf8 NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=1 ;
CREATE TABLE IF NOT EXISTS `product_options` (
`product_id` int(11)
,`name` longtext
,`price` longtext
,`description` longtext
,`buy_link` longtext
,`image_link` longtext
,`link` longtext
,`pid` longtext
,`discount_price` longtext
,`lowest_price` longtext
);
CREATE TABLE IF NOT EXISTS `property_identifier` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `start` text COLLATE utf8_unicode_ci NOT NULL,
  `end` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `occurence` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=1 ;

CREATE TABLE `search_log` (
`id` int(11) NOT NULL AUTO_INCREMENT,
`time` int(11) DEFAULT NULL,
`q` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
`search_for` text COLLATE utf8_unicode_ci,
`did_you_mean` text COLLATE utf8_unicode_ci,
`what_you_mean` text COLLATE utf8_unicode_ci,
`related_searches` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
`prodids` text COLLATE utf8_unicode_ci,
`prodnames` text COLLATE utf8_unicode_ci,
`ip` varchar(16) COLLATE utf8_unicode_ci DEFAULT NULL,
`useragent` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
`option_filter_time` int(11) NOT NULL DEFAULT '0',
`sorting_time` int(11) NOT NULL DEFAULT '0',
`widget_factory_time` int(11) NOT NULL DEFAULT '0',
`string_filter_timer` int(11) NOT NULL DEFAULT '0',
`product_factory_time` int(11) NOT NULL DEFAULT '0',
`total_search_time` int(11) NOT NULL DEFAULT '0',
PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE IF NOT EXISTS `search_templates` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `template_id` int(11) NOT NULL,
  `attributes` longtext COLLATE utf8_unicode_ci NOT NULL,
  `active` int(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=4 ;


CREATE TABLE IF NOT EXISTS `search_words` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `log_id` int(11) NOT NULL,
  `log_num` int(11) NOT NULL,
  `multiplyer` int(11) NOT NULL,
  `word` text COLLATE utf8_unicode_ci NOT NULL,
  `short` text COLLATE utf8_unicode_ci NOT NULL,
  `ending` text COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `log_id` (`log_id`,`log_num`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=3150 ;


CREATE TABLE IF NOT EXISTS `settings` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `value` text COLLATE utf8_unicode_ci NOT NULL,
  `skip_inheritance` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=14 ;


CREATE TABLE IF NOT EXISTS `user_defined_keywords` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `text` text COLLATE utf8_unicode_ci NOT NULL,
  `url` text COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=2 ;


CREATE TABLE IF NOT EXISTS `words` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `word` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `word_temp` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `rank` int(11)  DEFAULT '0', 
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=768 ;


CREATE TABLE IF NOT EXISTS `word_keywords` (
  `keyword_id` int(11) NOT NULL,
  `word` varchar(30) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`keyword_id`,`word`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE IF NOT EXISTS `word_relation` (
  `product_id` int(11) NOT NULL,
  `word_id` int(11) NOT NULL,
  `point` int(11) NOT NULL,
  `incategory` int(11) NOT NULL,
  `inname` int(11) NOT NULL,
  `indesc` int(11) NOT NULL,
  PRIMARY KEY (`product_id`,`word_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

DROP TABLE IF EXISTS `product_options`;

CREATE VIEW `product_options` AS select `options_values`.`product_id` AS `product_id`,max((case when (`options_settings`.`r_display_identifier` = 'name') then `options_values`.`name` else NULL end)) AS `name`,max((case when (`options_settings`.`r_display_identifier` = 'price') then `options_values`.`name` else NULL end)) AS `price`,max((case when (`options_settings`.`r_display_identifier` = 'description') then `options_values`.`name` else NULL end)) AS `description`,max((case when (`options_settings`.`r_display_identifier` = 'buy_link') then `options_values`.`name` else NULL end)) AS `buy_link`,max((case when (`options_settings`.`r_display_identifier` = 'image_link') then `options_values`.`name` else NULL end)) AS `image_link`,max((case when (`options_settings`.`r_display_identifier` = 'link') then `options_values`.`name` else NULL end)) AS `link`,max((case when (`options_settings`.`r_display_identifier` = 'pid') then `options_values`.`name` else NULL end)) AS `pid`,max((case when (`options_settings`.`r_display_identifier` = 'discount_price') then `options_values`.`name` else NULL end)) AS `discount_price`,max((case when (`options_settings`.`r_display_identifier` = 'lowest_price') then `options_values`.`name` else NULL end)) AS `lowest_price` from ((`options_settings` join `options` on((`options_settings`.`name` = `options`.`name`))) join `options_values` on((`options`.`id` = `options_values`.`option_id`))) group by `options_values`.`product_id`;
